About: The scene is the Club Dynamic, the hottest sex club in town. Tantalizing club owner Roxanne, played by none other than the voluptuous Vanessa Del Rio, puts her clientele under a unique hypnotic spell wich holds them in her control. Club Dynamic offers special pleasures with two daring dominatrixes played by Kelly Richards and Barbara Dare. Nina Hartley and Alexis Greco play two sexy detectives on the trail of Roxanne, trying to free her helpless victims. Lieutenant Smiley, played by Billy Dee, once narrowly missed falling prey to Roxanne's powers. Now he's back on the case, risking boy and soul to seduce Roxanne and break her magic spell
